// Banner image as base64
const LOGO_BASE64 = "";

// GitHub icon SVG
const GITHUB_SVG = `<svg width="16" height="16" viewBox="0 0 16 16" fill="currentColor">
  <path d="M8 0C3.58 0 0 3.58 0 8c0 3.54 2.29 6.53 5.47 7.59.4.07.55-.17.55-.38 0-.19-.01-.82-.01-1.49-2.01.37-2.53-.49-2.69-.94-.09-.23-.48-.94-.82-1.13-.28-.15-.68-.52-.01-.53.63-.01 1.08.58 1.23.82.72 1.21 1.87.87 2.33.66.07-.52.28-.87.51-1.07-1.78-.2-3.64-.89-3.64-3.95 0-.87.31-1.59.82-2.15-.08-.2-.36-1.02.08-2.12 0 0 .67-.21 2.2.82.64-.18 1.32-.27 2-.27.68 0 1.36.09 2 .27 1.53-1.04 2.2-.82 2.2-.82.44 1.1.16 1.92.08 2.12.51.56.82 1.27.82 2.15 0 3.07-1.87 3.75-3.65 3.95.29.25.54.73.54 1.48 0 1.07-.01 1.93-.01 2.2 0 .21.15.46.55.38A8.013 8.013 0 0016 8c0-4.42-3.58-8-8-8z"/>
</svg>`;

// Eye icons for reveal/hide
const EYE_ICON = `<svg width="18" height="18" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
  <path d="M1 12s4-8 11-8 11 8 11 8-4 8-11 8-11-8-11-8z"/>
  <circle cx="12" cy="12" r="3"/>
</svg>`;

const EYE_OFF_ICON = `<svg width="18" height="18" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
  <path d="M17.94 17.94A10.07 10.07 0 0112 20c-7 0-11-8-11-8a18.45 18.45 0 015.06-5.94M9.9 4.24A9.12 9.12 0 0112 4c7 0 11 8 11 8a18.5 18.5 0 01-2.16 3.19m-6.72-1.07a3 3 0 11-4.24-4.24"/>
  <line x1="1" y1="1" x2="23" y2="23"/>
</svg>`;

/**
 * Generate the HTML page served to receivers
 * @param {Object} options
 * @param {string} options.id - The secret ID
 * @param {string} [options.filename] - Original filename for file downloads
 * @returns {string} HTML content
 */
export function getReceiverPage({ id, filename }) {
  const isFile = !!filename;

  return `<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="Content-Security-Policy" content="default-src 'self'; script-src 'unsafe-inline'; style-src 'unsafe-inline'; img-src 'self' data: blob:; connect-src 'self'; frame-ancestors 'none'; form-action 'none'; base-uri 'self';">
  <title>send-secret</title>
  <link rel="icon" href="data:image/svg+xml,<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 100 100'><text y='.9em' font-size='90'></text></svg>">
  <style>
    * { box-sizing: border-box; margin: 0; padding: 0; }
    body {
      font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif;
      background: #07080d;
      color: #fafafa;
      min-height: 100vh;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      padding: 24px;
    }
    .wrapper { width: 100%; max-width: 520px; }
    .brand { text-align: center; margin-bottom: 32px; }
    .brand img { max-width: 200px; height: auto; }
    .container {
      background: linear-gradient(180deg, #0f1114 0%, #07080d 100%);
      border: 1px solid #1a1c22;
      border-radius: 16px;
      padding: 32px;
      box-shadow: 0 4px 24px rgba(0, 0, 0, 0.6);
    }
    .header { margin-bottom: 24px; }
    h1 { font-size: 22px; font-weight: 600; letter-spacing: -0.02em; margin-bottom: 8px; }
    .subtitle { color: #666; font-size: 14px; line-height: 1.5; }
    .secret-container { position: relative; margin: 24px 0; }
    .secret-box {
      background: #0a0b0f;
      border: 1px solid #1a1c22;
      border-radius: 12px;
      padding: 20px;
      font-family: "SF Mono", "Fira Code", "Consolas", monospace;
      font-size: 14px;
      line-height: 1.6;
      white-space: pre-wrap;
      word-break: break-all;
      max-height: 300px;
      overflow-y: auto;
      color: #e0e0e0;
      transition: filter 0.2s ease;
    }
    .secret-box.hidden { filter: blur(8px); user-select: none; }
    .secret-box::-webkit-scrollbar { width: 6px; }
    .secret-box::-webkit-scrollbar-track { background: transparent; }
    .secret-box::-webkit-scrollbar-thumb { background: #2a2d38; border-radius: 3px; }
    .file-card {
      background: #0a0b0f;
      border: 1px solid #1a1c22;
      border-radius: 12px;
      padding: 20px;
      margin: 24px 0;
      display: flex;
      align-items: center;
      gap: 16px;
    }
    .file-icon {
      width: 48px; height: 48px;
      background: linear-gradient(135deg, #111 0%, #0a0a0a 100%);
      border: 1px solid #1a1c22;
      border-radius: 10px;
      display: flex;
      align-items: center;
      justify-content: center;
      font-size: 22px;
      flex-shrink: 0;
    }
    .file-details { min-width: 0; }
    .file-name {
      font-family: "SF Mono", monospace;
      font-size: 14px;
      font-weight: 500;
      white-space: nowrap;
      overflow: hidden;
      text-overflow: ellipsis;
      margin-bottom: 4px;
    }
    .file-size { color: #666; font-size: 13px; }
    .actions { display: flex; gap: 12px; margin-top: 24px; }
    button, .btn {
      display: inline-flex;
      align-items: center;
      justify-content: center;
      gap: 8px;
      background: #fafafa;
      color: #0a0a0a;
      border: none;
      padding: 12px 24px;
      border-radius: 10px;
      font-size: 14px;
      font-weight: 500;
      cursor: pointer;
      transition: all 0.15s ease;
      text-decoration: none;
    }
    button:hover, .btn:hover { background: #fff; transform: translateY(-1px); box-shadow: 0 4px 12px rgba(255,255,255,0.1); }
    button:active, .btn:active { transform: translateY(0); }
    button.secondary { background: #14161c; color: #fafafa; }
    button.secondary:hover { background: #1c1e26; }
    .footer { margin-top: 32px; padding-top: 24px; border-top: 1px solid #1a1c22; text-align: center; }
    .footer-brand { display: inline-flex; align-items: center; gap: 8px; color: #555; font-size: 13px; text-decoration: none; transition: color 0.15s; }
    .footer-brand:hover { color: #888; }
    .footer-brand svg { opacity: 0.7; }
    .footer-tagline { color: #444; font-size: 12px; margin-top: 12px; line-height: 1.5; }
    .footer-cta { color: #888; font-size: 13px; margin-top: 20px; margin-bottom: 8px; }
    .install-cmd { display: inline-block; background: #0a0b0f; border: 1px solid #1a1c22; padding: 8px 16px; border-radius: 6px; font-family: "SF Mono", monospace; font-size: 13px; color: #51cf66; }
    .loading { display: flex; align-items: center; justify-content: center; padding: 48px 0; gap: 16px; }
    .spinner { width: 32px; height: 32px; border: 2px solid #1a1a1a; border-top-color: #555; border-radius: 50%; animation: spin 0.8s linear infinite; }
    .loading-text { color: #555; font-size: 14px; }
    @keyframes spin { to { transform: rotate(360deg); } }
    .error { color: #ff6b6b; text-align: center; padding: 24px; }
    .error-title { font-size: 18px; font-weight: 600; margin-bottom: 8px; }
    .error-message { color: #888; font-size: 14px; }
    .success-badge { display: inline-flex; align-items: center; gap: 6px; background: rgba(81,207,102,0.1); color: #51cf66; padding: 6px 12px; border-radius: 20px; font-size: 12px; font-weight: 500; margin-bottom: 16px; }
  </style>
</head>
<body>
  <div class="wrapper">
    <div class="brand">
      <img src="data:image/png;base64,${LOGO_BASE64}" alt="send-secret">
    </div>
    <div class="container">
      <div id="content">
        <div class="loading">
          <div class="spinner"></div>
          <div class="loading-text">Decrypting secret...</div>
        </div>
      </div>
    </div>
  </div>
  <script>
    const isFile = ${isFile};
    const filename = ${JSON.stringify(filename || "")};
    let secretVisible = false;
    const EYE_ICON = \`${EYE_ICON}\`;
    const EYE_OFF_ICON = \`${EYE_OFF_ICON}\`;

    async function main() {
      const content = document.getElementById('content');
      try {
        const fragment = window.location.hash.slice(1);
        const params = new URLSearchParams(fragment);
        const key = params.get('key');
        if (!key) throw new Error('Missing decryption key in URL');
        if (!/^[a-fA-F0-9]{64}$/.test(key)) throw new Error('Invalid decryption key format');
        const response = await fetch(window.location.pathname + '/blob?t=' + Date.now(), {
          cache: 'no-store',
          headers: { 'Cache-Control': 'no-cache' }
        });
        if (!response.ok) {
          if (response.status === 410) throw new Error('This secret has already been viewed');
          throw new Error('Failed to retrieve secret');
        }
        const encryptedData = await response.arrayBuffer();
        const decrypted = await decrypt(new Uint8Array(encryptedData), key);
        if (isFile) { showFileResult(decrypted, filename); }
        else { showTextResult(new TextDecoder().decode(decrypted)); }
      } catch (err) {
        content.innerHTML = '<div class="error"><div class="error-title">Unable to decrypt</div><div class="error-message">' + escapeHtml(err.message) + '</div></div>';
      }
    }

    function showTextResult(text) {
      const content = document.getElementById('content');
      content.innerHTML = \`
        <div class="header">
          <div class="success-badge"><svg width="14" height="14" viewBox="0 0 14 14" fill="none"><path d="M2.5 7L5.5 10L11.5 4" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/></svg>Decrypted</div>
          <h1>Secret Retrieved</h1>
          <p class="subtitle">End-to-end encrypted. Decrypted locally. One-time view.</p>
        </div>
        <div class="secret-container">
          <div class="secret-box hidden" id="secret">\${escapeHtml(text)}</div>
        </div>
        <div class="actions">
          <button onclick="toggleReveal()" id="revealBtn" class="secondary">\${EYE_ICON} Reveal</button>
          <button onclick="copySecret()"><svg width="16" height="16" viewBox="0 0 16 16" fill="none"><rect x="5" y="5" width="9" height="9" rx="2" stroke="currentColor" stroke-width="1.5"/><path d="M11 5V3C11 1.89543 10.1046 1 9 1H3C1.89543 1 1 1.89543 1 3V9C1 10.1046 1.89543 11 3 11H5" stroke="currentColor" stroke-width="1.5"/></svg>Copy</button>
        </div>
        <div class="footer">
          <a href="https://github.com/danwagner/send-secret" target="_blank" class="footer-brand">${GITHUB_SVG}<span>send-secret</span></a>
          <p class="footer-tagline">P2P encrypted sharing. No servers. No accounts. No trust required.</p>
          <p class="footer-cta">Start sending secrets securely</p>
          <code class="install-cmd">npm i -g send-secret</code>
        </div>
      \`;
    }

    function showFileResult(data, name) {
      document.title = name;
      const content = document.getElementById('content');
      const blob = new Blob([data]);
      const url = URL.createObjectURL(blob);
      const size = formatBytes(data.byteLength);
      content.innerHTML = \`
        <div class="header">
          <div class="success-badge"><svg width="14" height="14" viewBox="0 0 14 14" fill="none"><path d="M2.5 7L5.5 10L11.5 4" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/></svg>Decrypted</div>
          <h1>File Retrieved</h1>
          <p class="subtitle">End-to-end encrypted. Decrypted locally. One-time download.</p>
        </div>
        <div class="file-card">
          <div class="file-icon"></div>
          <div class="file-details"><div class="file-name">\${escapeHtml(name)}</div><div class="file-size">\${size}</div></div>
        </div>
        <div class="actions">
          <a href="\${url}" download="\${escapeHtml(name)}" class="btn"><svg width="16" height="16" viewBox="0 0 16 16" fill="none"><path d="M8 1V10M8 10L4 6M8 10L12 6" stroke="currentColor" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round"/><path d="M1 11V13C1 14.1046 1.89543 15 3 15H13C14.1046 15 15 14.1046 15 13V11" stroke="currentColor" stroke-width="1.5" stroke-linecap="round"/></svg>Download file</a>
        </div>
        <div class="footer">
          <a href="https://github.com/danwagner/send-secret" target="_blank" class="footer-brand">${GITHUB_SVG}<span>send-secret</span></a>
          <p class="footer-tagline">P2P encrypted sharing. No servers. No accounts. No trust required.</p>
          <p class="footer-cta">Start sending secrets securely</p>
          <code class="install-cmd">npm i -g send-secret</code>
        </div>
      \`;
    }

    function toggleReveal() {
      const secretBox = document.getElementById('secret');
      const btn = document.getElementById('revealBtn');
      secretVisible = !secretVisible;
      if (secretVisible) { secretBox.classList.remove('hidden'); btn.innerHTML = EYE_OFF_ICON + ' Hide'; }
      else { secretBox.classList.add('hidden'); btn.innerHTML = EYE_ICON + ' Reveal'; }
    }

    async function decrypt(data, keyHex) {
      const keyBytes = new Uint8Array(keyHex.match(/.{1,2}/g).map(byte => parseInt(byte, 16)));
      const iv = data.slice(0, 12);
      const authTag = data.slice(12, 28);
      const ciphertext = data.slice(28);
      const ciphertextWithTag = new Uint8Array(ciphertext.length + authTag.length);
      ciphertextWithTag.set(ciphertext);
      ciphertextWithTag.set(authTag, ciphertext.length);
      const cryptoKey = await crypto.subtle.importKey('raw', keyBytes, { name: 'AES-GCM' }, false, ['decrypt']);
      const decrypted = await crypto.subtle.decrypt({ name: 'AES-GCM', iv }, cryptoKey, ciphertextWithTag);
      return new Uint8Array(decrypted);
    }

    function escapeHtml(text) { const div = document.createElement('div'); div.textContent = text; return div.innerHTML; }
    function formatBytes(bytes) { if (bytes < 1024) return bytes + ' B'; if (bytes < 1024 * 1024) return (bytes / 1024).toFixed(1) + ' KB'; return (bytes / 1024 / 1024).toFixed(1) + ' MB'; }

    function copySecret() {
      const secret = document.getElementById('secret').textContent;
      navigator.clipboard.writeText(secret).then(() => {
        const btns = document.querySelectorAll('button');
        const copyBtn = btns[1];
        copyBtn.innerHTML = '<svg width="16" height="16" viewBox="0 0 16 16" fill="none"><path d="M2 8L6 12L14 4" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/></svg>Copied!';
        setTimeout(() => { copyBtn.innerHTML = '<svg width="16" height="16" viewBox="0 0 16 16" fill="none"><rect x="5" y="5" width="9" height="9" rx="2" stroke="currentColor" stroke-width="1.5"/><path d="M11 5V3C11 1.89543 10.1046 1 9 1H3C1.89543 1 1 1.89543 1 3V9C1 10.1046 1.89543 11 3 11H5" stroke="currentColor" stroke-width="1.5"/></svg>Copy'; }, 2000);
      });
    }

    main();
  </script>
</body>
</html>`;
}
